def get_window_query_priority(
    window: Dict[str, str],
    max_interactive: int = 100,
) -> str:
  """Returns a query priority depending on the window number."""
  if int(window['window_number']) <= max_interactive:
    return 'INTERACTIVE'
  else:
    return 'BATCH'

